    <div className="my-8">
      <div className="mb-12">
        <img src="./static/slides/slide1.jpg" alt="Mandalorian" />
      </div>
      <div className="categories flex items-center mb-12">
        <div className="w-1/5 px-4">
          <div className="bg-gray-800 h-32 flex justify-center items-center rounded-lg hover:bg-gray-100">
            <img src="./static/logos/disney_logo.svg" alt="disney" />
          </div>
        </div>
      </div>
      <p className="mb-32">
        Lorem ipsum dolor sit amet consectetur adipisicing elit. Dolore a error
        velit, eligendi incidunt esse nostrum soluta mollitia nemo tenetur
        quibusdam voluptates iure rem necessitatibus? Repellat iusto sapiente
        minus est?
      </p>
    </div>
  );
};

export default Home;
